import React, { useState } from 'react';
import './Header.css';

const Header = ({ onNavigate }) => {
  const [searchTerm, setSearchTerm] = useState('');
  const [showPhotosDropdown, setShowPhotosDropdown] = useState(false);
  const [showProfessionalsDropdown, setShowProfessionalsDropdown] = useState(false);
  const [showAdviceDropdown, setShowAdviceDropdown] = useState(false);

  const photosDropdownItems = [
    { id: 'photos', name: 'Photos', hasSubmenu: true },
    { id: 'kitchen-dining', name: 'Kitchen & Dining', submenu: ['Kitchen', 'Modular Kitchen', 'Dining Room', 'Home Bar'] },
    { id: 'bed-bath', name: 'Bed & Bath', submenu: ['Bedroom', 'Nursery', "Kid's Room", 'Bathroom'] },
    { id: 'living', name: 'Living', submenu: ['Living Room', 'Home Theater', 'Home Office', 'Staircase'] },
    { id: 'outdoor', name: 'Outdoor', submenu: ['Garden', 'Patio', 'Terrace & Balcony', 'Courtyard'] },
    { id: 'more-rooms', name: 'More Rooms', submenu: ['Puja Room', 'Wardrobe', 'Exterior', 'Swimming Pool', 'View All'] }
  ];

  const handleSearch = () => {
    if (searchTerm.trim()) {
      alert(`Searching for: ${searchTerm}`);
      // In a real app, this would trigger search functionality
    }
  };

  const handleNavClick = (navItem) => {
    if (navItem === 'Photos' && onNavigate) {
      onNavigate('photos');
    } else {
      alert(`Navigating to ${navItem}`);
    }
    // Close all dropdowns
    setShowPhotosDropdown(false);
    setShowProfessionalsDropdown(false);
    setShowAdviceDropdown(false);
  };

  const handleSubmenuClick = (item) => {
    alert(`Navigating to ${item} photos`);
    setShowPhotosDropdown(false);
  };

  const handleSignIn = () => {
    alert('Opening Sign In modal');
    // In a real app, this would open authentication modal
  };

  const handleJoinAsPro = () => {
    alert('Opening Professional Registration');
    // In a real app, this would navigate to pro registration
  };

  return (
    <header className="header">
      <div className="container">
        <div className="header-content">
          <div className="logo">
            <img src="/logo.svg" alt="houzz" className="logo-img" />
          </div>
          
          <nav className="nav">
            <div 
              className="nav-item dropdown"
              onMouseEnter={() => setShowPhotosDropdown(true)}
              onMouseLeave={() => setShowPhotosDropdown(false)}
            >
              <span onClick={() => handleNavClick('Photos')}>Photos</span>
              <span className="dropdown-arrow">‚ñº</span>
              
              {showPhotosDropdown && (
                <div className="dropdown-menu photos-dropdown">
                  {photosDropdownItems.map(section => (
                    <div key={section.id} className="dropdown-section">
                      <div className="section-header">
                        <strong>{section.name}</strong>
                      </div>
                      {section.submenu && (
                        <div className="submenu">
                          {section.submenu.map(item => (
                            <div 
                              key={item}
                              className="submenu-item"
                              onClick={() => handleSubmenuClick(item)}
                            >
                              {item}
                            </div>
                          ))}
                        </div>
                      )}
                    </div>
                  ))}
                </div>
              )}
            </div>
            
            <div 
              className="nav-item dropdown"
              onMouseEnter={() => setShowProfessionalsDropdown(true)}
              onMouseLeave={() => setShowProfessionalsDropdown(false)}
            >
              <span onClick={() => handleNavClick('Find Professionals')}>Find Professionals</span>
              <span className="dropdown-arrow">‚ñº</span>
              
              {showProfessionalsDropdown && (
                <div className="dropdown-menu">
                  <div className="dropdown-item">Interior Designers</div>
                  <div className="dropdown-item">Architects</div>
                  <div className="dropdown-item">Contractors</div>
                  <div className="dropdown-item">Kitchen Designers</div>
                  <div className="dropdown-item">Landscape Architects</div>
                </div>
              )}
            </div>
            
            <div 
              className="nav-item dropdown"
              onMouseEnter={() => setShowAdviceDropdown(true)}
              onMouseLeave={() => setShowAdviceDropdown(false)}
            >
              <span onClick={() => handleNavClick('Advice')}>Advice</span>
              <span className="dropdown-arrow">‚ñº</span>
              
              {showAdviceDropdown && (
                <div className="dropdown-menu">
                  <div className="dropdown-item">Design Ideas</div>
                  <div className="dropdown-item">How-To Guides</div>
                  <div className="dropdown-item">Product Reviews</div>
                  <div className="dropdown-item">Cost Guides</div>
                </div>
              )}
            </div>
          </nav>

          <div className="search-container">
            <input
              type="text"
              placeholder="Search Houzz"
              value={searchTerm}
              onChange={(e) => setSearchTerm(e.target.value)}
              onKeyPress={(e) => e.key === 'Enter' && handleSearch()}
              className="search-input"
            />
            <button className="search-btn" onClick={handleSearch}>üîç</button>
          </div>

          <div className="auth-buttons">
            <button className="btn btn-secondary" onClick={handleSignIn}>Sign In</button>
            <button className="btn btn-primary" onClick={handleJoinAsPro}>Join as a Pro</button>
          </div>
        </div>
      </div>
    </header>
  );
};

export default Header;
